body:
These changes made it easier for me to use restangular.

Simple example below:

```
class Account {
    name: string;
}
interface IIndexScope extends ng.IScope {
    accounts: Account[];
}
[...]
$scope.accounts = Restangular.all('api/accounts').getList<Account>().$object;
```

If you read the docs thoroughly (which I didn't at first) the function should return a promise.

An example usage of $asyncValidators inside a link function to check if the e-mail is not taken:

``` typescript
function (scope: ng.IScope, elem: JQuery, attrs: ng.IAttributes, ngModel:ng.INgModelController) {

                ngModel.$asyncValidators['emailAvailable'] = (modelValue:string, viewValue:string) => {
                    var value: string = modelValue || viewValue;

                    var deferred: ng.IDeferred<boolean> = $q.defer();

                    accountFactory.isEmailAvailable(<string>value).then(data => {
                        //the response of this call is OK, the address is free
                        deferred.resolve(true);
                    }, err => {
                        //An 4XX errorcode is given when the e-mail is already taken
                        deferred.reject("Email exists");
                    });

                    return deferred.promise;
                };
            }
```
